    break;
  case BC_ISEQS: case BC_ISNES:
    vk = op == BC_ISEQS;
    dasm_put(Dst, 9673, LJ_TSTR);
  iseqne_test:
    if (vk) {
      dasm_put(Dst, 9556);
    } else {
      dasm_put(Dst, 8910);
    }
